import React from "react";
import styled from "styled-components";

const StyledLi = styled.li`
  width: 100%;
  list-style: none;
  display: flex;
  align-items: center;
  justify-content: space-between;
  border: 1px solid ${props => (props.sex ? "pink" : "blue")};
  margin: 0 auto 10px auto;
  padding: 5px;
  border-radius: 25px;
  overflow: hidden;

  &:last-of-type {
    margin: unset;
  }

  div {
    height: 40px;
    width: 40px;
    border-radius: 50%;
    img {
      height: 100%;
      width: 100%;
      object-fit: cover;
    }
  }
`;

const User = ({ userData }) => {
  const {
    address: { city, street, houseNumber },
    _id,
    name,
    email,
    sex,
    avatar,
    age,
    __v
  } = userData;

  return (
    <StyledLi sex={sex}>
      <div>
        <img src={avatar} alt={`${name}-image`} />
      </div>
      <h1>{name}</h1>
      <p>
        {city},{street},{houseNumber}
      </p>
      <p>{email}</p>
      <p>{age} lat</p>
    </StyledLi>
  );
};

export default User;
